import 'bootstrap/dist/css/bootstrap.min.css';
import React, { Component } from 'react';
import './../../styles/main.css'
import ContainerChannels from './../channels/index'
import {getService} from "../../services/services";
import {Routes} from "../../services/routes";

class Main extends Component {

    logout(){
        let token = localStorage.getItem('@websession');

        let headers = {
            Authorization: 'Bearer ' + token,
            'Content-Type': 'application/json',
            'Accept': 'application/json'
        };

        getService(Routes.LOGOUT, headers).then(data => {
            localStorage.removeItem('@websession');
            setTimeout(function () {
                window.location.href = "/";
            }, 2000);
        });
    }

    render() {
        return (
            <div className="container">
                <input type="submit" className="fadeIn fourth" value="Salir" onClick={()=> this.logout()}/>
                <h3 className=" text-center">Chat</h3>
                <div className="messaging">
                    <ContainerChannels/>
                </div>
            </div>
            )
    }
}

export default Main;
